INSERT INTO `sessions` (`id`, `name`, `link`, `books`, `Attachments`, `Assignments`, `description`, `datetime`, `clap`, `status`) VALUES
(1, 'Demo 1', 'https://www.youtube.com/embed/pWOk4H2FzmY', '', '', '', 'Artificial intelligence (AI) platforms provide users a tool kit to build intelligent applications. These platforms combine intelligent, decision-making algorithms with data, which enables developers to create a business solution. Some platforms offer pre-built algorithms and simplistic workflows with such features as drag-and-drop modeling and visual interfaces that easily connect necessary data to the end solution, while others require a greater knowledge of development and coding. These algorithms can include functionality for image recognition, natural language processing, voice recognition, recommendation systems, and predicitve analytics, in addition to other machine learning capabilities.', '2018-12-22 02:02:26', 0, 1),
(2, 'Demo 2', 'https://www.youtube.com/embed/SHL9H7Lt3Y4', '', '', '', 'As the world entered the era of big data, the need for its storage also grew. It was the main challenge and concern for the enterprise industries until 2010. The main focus was on building framework and solutions to store data. Now when Hadoop and other frameworks have successfully solved the problem of storage, the focus has shifted to the processing of this data. Data Science is the secret sauce here. All the ideas which you see in Hollywood sci-fi movies can actually turn into reality by Data Science. Data Science is the future of Artificial Intelligence. Therefore, it is very important to understand what is Data Science and how can it add value to your business.', '2018-12-29 02:28:16', 0, 1),
